  useEffect(() => {
    async () => {
      try {
        const Response = await axios.get("http://localhost:3000/details");
        setTotal(Response.data);
      } catch (error) {
        alert(error.msg);
      }
    };
  }, [myData]);

  return (
    <div>
      <div className="table-data">
        <table>
          <tr>
            <th>SI.NO</th>
